function Authentication(props) {

auth = ()=>{
    if(this.props.redirect)
    {
        return <Redirect to='/home' />
    }
    else
    {
        return;
    }
}
    return (
            <div>
                {auth()}
            </div>
    );

  }
export default Authentication
